bad c++ code here
incr(*age)  -->
incr(age);

正确应为i.f();
如果按照原来的代码System.out.println(i);运行了一下，无论Lambda表达式里面的内容如何都只是打印类名。
难道是有意为之，那麻烦能加上注释解释这样写的原因。

因为AtomicMarkableReference是通过内部类Pair实现数据存储，每次替换都是通过Pair.of方法new一个类出来进行替换原先的值
如果ABA出现，那么最后的A肯定是一个新的Pair实例，即当前的A和之前的A不是同一个实例，当线程使用compareAndSet则会返回false
以下是compareAndSet的实现：
public boolean compareAndSet(V       expectedReference,
                       V       newReference,
                       boolean expectedMark,
                       boolean newMark) {
        Pair<V> current = pair;
        return
            expectedReference == current.reference &&
            expectedMark == current.mark &&
            ((newReference == current.reference &&
              newMark == current.mark) ||
             casPair(current, Pair.of(newReference, newMark)));
    }

ROPAGATION_NESTED：如果当前存在事务，就在嵌套事务内执行；如果当前没有事务，就执行与PROPAGATION_REQUIRED类似的操作，子事务回滚外部主事务也会受到影响进行回滚



